import React, { Component } from 'react'
import {storeProducts} from "./data"

export default class Table extends Component {
    tableRow = storeProducts.map((item, index)=>{
        return (
            <tr key={index}>
                {item.month}
            </tr>
        )
    })
    render() {
        return (
            <table>
                <tr>
                    <th>
                        month
                    </th>
                </tr>
                <tr>
                    <td>
                        {tableRow}
                    </td>
                </tr>
            </table>
        )
    }
}
